# ## Data Preprocessing
# 
# In this section, we will make the data available for RNN. 
# - Split the data as train and test
# - Normalize data.
# - X_train - y_train 
# - Reshape

# MARKDOWN ********************

# ### Split Data
# In this section, we will separate the data we have as a train and test.

# CELL ********************

training_size = int(len(data)*0.80)
data_len = len(data)

train, test = data[0:training_size],data[training_size:data_len]

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# CELL ********************

print("Training Size --> ", training_size)
print("total length of data --> ", data_len)
print("Train length --> ", len(train))
print("Test length --> ", len(test))

