# ## Implementing with Keras 
# 
# In this section, we create and fit  RNN model. </p>
# 
# - Create Model</li>
# - Compile Model</li>
# - Epochs and Batch Size</li>
# - Fit the model</li>
# </ul>

# MARKDOWN ********************

# ## Create Model
# 
# We are importing the libraries we will use for our model.
# Later, we will create our RNN model.

# CELL ********************

from keras.models import Sequential
from keras.layers import Dense
from keras.layers import SimpleRNN
from keras.layers import Dropout

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# 
# - units --> Positive integer, dimensionality of the output space
# - activation --> Activation function to use. Default: hyperbolic tangent (tanh). If you pass None, no activation is applied (ie. "linear" activation: a(x) = x).
# - return_sequences --> Boolean. Whether to return the last output in the output sequence, or the full sequence. Default: False.
# - inputs --> A 3D tensor, with shape [batch, timesteps, feature].
# For detail referance --> <a href = "https://keras.io/api/layers/recurrent_layers/simple_rnn/" >https://keras.io/api/layers/recurrent_layers/simple_rnn/ </a> </p>

# CELL ********************

regressor = Sequential()

regressor.add(SimpleRNN(units = 50, activation = "tanh", return_sequences = True, input_shape = (X_train.shape[1],1)))
regressor.add(Dropout(0.2))

regressor.add(SimpleRNN(units = 50, activation = "tanh", return_sequences = True))
regressor.add(Dropout(0.2))

regressor.add(SimpleRNN(units = 50, activation = "tanh", return_sequences = True))
regressor.add(Dropout(0.2))

regressor.add(SimpleRNN(units = 50))
regressor.add(Dropout(0.2))

regressor.add(Dense(units = 1))

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# ### Compile Model
# 
# - optimizer --> The optimizer does the process of updating our parameters for us here. some kind of healer I can say. There are methods used for multiple optimizers, and you should choose the most suitable one for the model. 
# 
# - loss --> It is a number that indicates how good or bad the model is to its prediction. As it approaches 0, the error starts to decrease.

# CELL ********************

regressor.compile(optimizer= "adam", loss = "mean_squared_error")

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# CELL ********************

epochs = 100 
batch_size = 20

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# ### Fit the model 
# 
# We train the model we created above using our data. 

# CELL ********************

regressor.fit(X_train, y_train, epochs = epochs, batch_size = batch_size)

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# ## Predictions
# 
# We will make predictions using the model we have created.

# CELL ********************

test.head()

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# We use the data we separated above as our test data.

# CELL ********************

real_price = test.loc[:, ["Open"]].values
print("Real Price Shape --> ", real_price.shape)

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# Since we use the "open" feature while training the model, we will use the same feature while testing.


# CELL ********************

dataset_total = pd.concat((data["Open"], test["Open"]), axis = 0)
inputs = dataset_total[len(dataset_total) - len(test) - timesteps:].values.reshape(-1,1)
inputs = scaler.transform(inputs)

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# We distinguish the values that we will guess. 

# CELL ********************

X_test = []

for i in range(timesteps, 412):
    X_test.append(inputs[i-timesteps:i, 0])
X_test = np.array(X_test)

print("X_test shape --> ", X_test.shape)

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# Finally, we trained our model according to the steps above. We generate our test data based on this number of steps. 

# CELL ********************

X_test = np.reshape(X_test, (X_test.shape[0], X_test.shape[1], 1))
predict = regressor.predict(X_test)
predict = scaler.inverse_transform(predict)

# METADATA ********************

# META {
# META   "language": "python",
# META   "language_group": "synapse_pyspark"
# META }

# MARKDOWN ********************

# We can now make an estimate here as data is ready to predict. 
# - Inverse_transform --> If you remember before training our model, we normalized our data. converts these values to before normalization. </p> </li>
# </ul>

# MARKDOWN ********************

# ## Evaluate the model 
# Finally let's take a look at our results by comparing our predictions with real data.

# CELL ********************

plt.plot(real_price, color = "red", label = "Real Stock Price")
plt.plot(predict, color = "black", label = "Predict Stock Price")
plt.title("Stock Price Prediction")
plt.xlabel("Time")
plt.ylabel("Tesla Stock Price")
plt.legend()
plt.show()

